function Page2({str, data}) {
	function onClick () {
		import('../srcs/SplitFunction').then(({ func }) => console.log(func()));
	}

	return (
		<div>
			<Head>
				<title>page2</title>
			</Head>
			<Head>
				<meta nema="description" content="hello world"/>
			</Head>
			<p>{str}</p>
			<p>{data}</p>
			<button onClick={onClick}>Split Code</button>
		</div>
	)
}

export default Page2
